import Layout from "../components/Layout";

const Index = props => (
  <Layout>
    <Breadcrumb>
      <BreadcrumbItem>
        <a href="/">Home</a>
      </BreadcrumbItem>
    </Breadcrumb>
    <HomeCarousel />
    <Container>
